import React from 'react';

const Cards = ({ results }) => {

    let display;
    console.log(results);

    if (results) {
        display = results.map((x) => {
            let {id, name, image } = x;
            return (
            <div key={id} className="col-4">
                <div className="">
                    <img src={image} className="img-fluid" />
                    <div className='content'>
                        <div className='fs-4 fw-bold'>
                            {name}
                        </div>
                    </div>
                </div>  
                
                
                
            </div>);
        });
    }
    else {
        display = "0 Character Found";
    }




    return (
        <>
            {display}
        </>
    )
}

export default Cards
